import { createMuiTheme } from '@material-ui/core';

const darkTheme = {
    palette: {
        background: {
            default: "#1c2025"
        },
        primary: {
            main: "#282C34",
        },
        secondary: {
            main: "#8a85ff",
        },
        textPrimary: {
            main: "white"
        }
    },
};
const lightTheme = {
    palette: {
        background: {
            default: "#fefefe"
        },
        primary: {
            main: "#eee",
        },
        secondary: {
            main: "#8a85ff",
        },
        textPrimary: {
            main: "black"
        }
    },
};

export { darkTheme, lightTheme }
